import React, { useState } from 'react';
import axios from 'axios';

const EvaluateForm = ({ combinedAST }) => {
  const [userData, setUserData] = useState({ age: '', department: '', salary: '', experience: '' });
  const [result, setResult] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const response = await axios.post('http://localhost:5000/api/rules/evaluate-rule', { ast: combinedAST, userData });
    setResult(response.data.result);
  };

  return (
    <form className="max-w-lg mx-auto p-4 bg-white shadow-md rounded-md mt-6" onSubmit={handleSubmit}>
      <input
        type="number"
        className="block w-full mb-4 border px-4 py-2 rounded-md"
        placeholder="Age"
        value={userData.age}
        onChange={(e) => setUserData({ ...userData, age: e.target.value })}
      />
      <input
        type="text"
        className="block w-full mb-4 border px-4 py-2 rounded-md"
        placeholder="Department"
        value={userData.department}
        onChange={(e) => setUserData({ ...userData, department: e.target.value })}
      />
      <input
        type="number"
        className="block w-full mb-4 border px-4 py-2 rounded-md"
        placeholder="Salary"
        value={userData.salary}
        onChange={(e) => setUserData({ ...userData, salary: e.target.value })}
      />
      <input
        type="number"
        className="block w-full mb-4 border px-4 py-2 rounded-md"
        placeholder="Experience"
        value={userData.experience}
        onChange={(e) => setUserData({ ...userData, experience: e.target.value })}
      />
      <button className="w-full bg-yellow-500 text-white py-2 rounded-md">Evaluate</button>

      {result !== null && (
        <div className="mt-4">
          <h3 className="text-lg font-bold">Result: {result ? 'True' : 'False'}</h3>
        </div>
      )}
    </form>
  );
};

export default EvaluateForm;
